    },
    {
        key : 3,
        position : {lat : 46.750930 , lng : 23.596210},
        icon : {url : "/images/P.png" , scaledSize : new window.google.maps.Size(50 , 50)}
    },
    {
        key : 4,
        position : {lat : 46.770910 , lng : 23.593310},
        icon : {url : "/images/P.png" , scaledSize : new window.google.maps.Size(50 , 50)}
    },
    {
        key : 5,
        position : {lat : 46.767700 , lng : 23.624330},
        icon : {url : "/images/P.png" , scaledSize : new window.google.maps.Size(50 , 50)}
    }
]

export default markers;
